Description:
NO RISK IN RIX
"Gee whiz, this is classy living."
This beautiful townhouse has a well thought-out floor plan located in the ever-appealing west side of Officer. The property at Rix Road is centrally located. Walking distance to Maranatha School, Officer train station and shopping centres.
This property has everything you'd expect to find in a family home:
- Large open plan living & dining area;
- Three spacious bedrooms with robes;
- Master with triple built-in robe and ensuite bathroom with oversized shower;
- Second large living room upstairs;
- Main bathroom with separate toilet;
- Split system air conditioners;
- European laundry;
- Double garage on remote with internal access;
- Paved alfresco;
- Fully enclosed low maintenance yard.
Ray White prides itself on being as accurate as possible however anyone considering purchasing the property should undertake their own due diligence to confirm the above.
